    public class Title : StackLayout
    {
        private ColorUI currentColorUI = ColorUI.White;
        private DesignType currentDesignType = DesignType.Ribbon;
        private Position currentPosition = Position.Left;

        private TitleImage imageTitle;
        private Label labelText;
        private FontAttributes currentFontType = FontAttributes.Bold;
        private AbsoluteLayout abs;

        private double yShadow = 0.2;
        private double yNormal = 0.5;

        /// <summary>
        /// Constructor of Title
        /// </summary>
        public Title()
        {
            InitializeComponents();
        }

        private void InitializeComponents()
        {
            InitAll();
        }

        private void InitAll()
        {
            abs = new AbsoluteLayout();
            abs.HorizontalOptions = LayoutOptions.Start;

            CreateTitle();

            abs.Children.Add(imageTitle);
            abs.Children.Add(labelText);

            this.Children.Add(abs);
        }

        private void CreateTitle()
        {
            imageTitle = new TitleImage("__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl", currentDesignType, currentColorUI, currentPosition);
            imageTitle.HorizontalOptions = LayoutOptions.Center;
            imageTitle.WidthRequest = Width;
            imageTitle.HeightRequest = Height;
            
            labelText = new Label();
            labelText.Text = Text;
            labelText.TextColor = TextColor;
            labelText.FontAttributes = currentFontType;
            labelText.BackgroundColor = Color.Transparent;
            labelText.FontFamily = FontFamily;
            labelText.HorizontalOptions = LayoutOptions.Start;
            AbsoluteLayout.SetLayoutFlags(labelText, AbsoluteLayoutFlags.PositionProportional);
            AbsoluteLayout.SetLayoutBounds(labelText, new Rectangle(0.5, 0.5, -1, -1));

           // AbsoluteLayout.SetLayoutBounds(labelText, new Rectangle(0.5, GetY(), -1, -1));
            // AbsoluteLayout.SetLayoutBounds(labelText, new Rectangle(0.5, yNormal, -1, -1));
           // labelText.VerticalOptions = LayoutOptions.End;
            //if (DesignType == DesignType.ShadowBottom)
            //{
            //    labelText.Margin = new Thickness(0, 0, 0, 2.0);
            //}
        }


        private double GetY()
        {
            if (currentDesignType == DesignType.Ribbon)
            {
                return yShadow;
            }
            else
            {
                return yNormal;
            }
        }


        /// <summary>
        /// Set if is ColorUI
        /// </summary>
        [Bindable(true)]
        public ColorUI ColorUI
        {
            get
            {
                return currentColorUI;
            }
            set
            {
                currentColorUI = value;
                ColorUIPropertyChanged();
            }
        }

        private void ColorUIPropertyChanged()
        {
            imageTitle.ChangeColor("__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl", currentColorUI);
        }

        /// <summary>
        /// Set DesignType
        /// </summary>
        [Bindable(true)]
        public DesignType DesignType
        {
            get
            {
                return currentDesignType;
            }
            set
            {
                currentDesignType = value;
                DesignTypePropertyChanged();
            }
        }

        private void DesignTypePropertyChanged()
        {
            imageTitle.ChangeDesignType("__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl", currentDesignType);
        }

        /// <summary>
        /// Set Position
        /// </summary>
        [Bindable(true)]
        public Position Position
        {
            get
            {
                return currentPosition;
            }
            set
            {
                currentPosition = value;
                PositionPropertyChanged();
            }
        }

        private void PositionPropertyChanged()
        {
            //ositionTitle copyPosition = (PositionTitle)newValue;

            //byte[] imageBytes = Convert.FromBase64String(title.GetColor(title, title.currentDesignTypeTitle, copyPosition, title.currentColorUI)); 

            //var streamImage = new System.IO.MemoryStream(imageBytes);
            //title.imageTitle.Source = ImageSource.FromStream(() => streamImage);

            imageTitle.ChangePosition("__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl", currentPosition);

            if (currentPosition == Position.Left)
            {
                abs.HorizontalOptions = LayoutOptions.Start;
            }
            else if (currentPosition == Position.Right)
            {
                abs.HorizontalOptions = LayoutOptions.End;
            }
            else if (currentPosition == Position.Center)
            {
                abs.HorizontalOptions = LayoutOptions.Center;
            }
            
        }

